import React from 'react';
import "./navbar.css";
import Logo from "../../assets/img/logo-navbar.svg"

const Navbar = () => {
    return (
        <div className="navbar">
            <div>
                <img src={Logo} className="navbar__logo"/>
                <div className="navbar__header"> Not Forgot</div>
                <div className="navbar__register"> Registration </div>
                <div className="navbar__login"> Login </div>
            </div>
        </div>
    );
};

export default Navbar;
